import React from 'react';
import Navbar from './components/Navbar/Navbar';
import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";

function Home() {
  return <h2>Home</h2>;
}

function About() {
  return <h2>About</h2>;
}

function Users() {
  return <h2>Users</h2>;
}

function App() {
  return (
    <div className="App">
      <Router>
        <Navbar />
          <Switch>
            <Route path="/projects"> <About /> </Route>
            <Route path="/contact"> <Users /> </Route>
            <Route path="/"> <Home /> </Route>
          </Switch>
      </Router>
    </div>
  );
}

export default App;
